import React from 'react';
import { Text, StyleSheet, View, TextInput } from 'react-native';
import Header from '../../components/Header';

const CreateRecord = () => {
    return (
        <>
            <Header />
            <View>
                <TextInput />
            </View>
        </>
    );
}

const styles = StyleSheet.create({
    text: {
      color: '#ffff',
      fontSize: 50,
      textAlign: 'center',
      marginTop: 100
    }
});

export default CreateRecord;
